import Link from 'next/link';
import Header from '../components/Header';
import Layout from '../components/Layout';

const PostLink = props => (
    <li>
        <Link href={`/post?title=${props.title}`}>
            <a>{props.title}</a>
        </Link>
    </li>
)

export default function Blog(){
    return (
        <div>

            <Layout >
                <p>Hello NextJS</p>
            </Layout>
        </div>
    )
}
